import React from "react";
import PopupWithForm from "./PopupWithForm";
import union from "../images/Union.png";
import unionError from "../images/UnionError.png";
// popup_opened

function InfoTooltip(props) {

  return (
    <div className={`popup`}>
      <div className="popup__checkContainer">
        <button
          className="popup__close"
          type="button"
          aria-label="Закрытие формы"
          onClick={props.onClose}
        ></button>
        <img className="popup__checkImage" src={unionError}></img>
        <h3 className="popup__status">Вы успешно зарегистрировались!</h3>
      </div>
    </div>
  )
}

export default InfoTooltip;
